import styled from 'styled-components';

const FeaturedSide = () => {
    return(
        <Wrapper>
            <Heading>Sheikhs</Heading>
        </Wrapper>
    )
}
const Wrapper = styled.div`
padding-top:14px;

`
const Heading = styled.h2`
color:white;
padding:8px;
width:max-content;
background-color:#50c878;
font-size:24px;
font-weight:bold;
font-family:inherit;
margin-left:auto;
`
export default FeaturedSide;
